      subtitleItem: 'Ультразвуковая система',
      itemDesc: "Система Philips HD5 поможет вам предоставить пациентам именно ту высококачественную медицинскую помощь, в которой они нуждаются. HD5 — это полнофункциональная ультразвуковая система с цветовыми режимами, обладающая широкими возможностями, обеспечивающая превосходное качество изображений и при этом вполне доступная по цене.",
      oss: [{
        img: '',
        title: 'Набор режимов визуализации поможет вам увидеть то, что требуется',
        text: 'В системе HD5 реализован широкий набор режимов визуализации: режим с технологией точной фокусировки Philips Microfine 2D, энергетическое цветовое картирование Philips Color Power Angio (ЭДК), направленный энергетический режим Directional Color Power Angio, M-режим, анатомический M-режим, цветной M-режим, импульсно-волновой доплер, доплерография с высокой частотой повторения импульсов, непрерывно-волновой доплер, 3D, цветовой режим сравнения, режим двух изображений, дуплексный режим 2D + доплер, триплексный режим 2D + Doppler + ЦДК/ЭДК, 2D-режим с обработкой и оптимизацией сигнала, тканевая гармоника, интеллектуальный доплеровский режим, функция реконструкции увеличения с панорамированием (увеличение при считывании), функция Philips увеличения с высокой четкостью (увеличение при записи), трапециевидный режим, адаптивный доплеровский режим, адаптивный режим ЦДК.'
      }, {
        img: '',
        title: 'Отличная производительность по доступной цене',
        text: 'Система HD5 отличается впечатляющим набором возможностей и на удивление доступной ценой. Режим 2D с 256 оттенками серого (8 бит), широкополосный цифровой формирователь пучка, широкий динамический диапазон и цифровая фокусировка — помимо этого систему HD5 характеризует также технология быстрой оптимизации изображений iSCAN, несколько портов для датчиков и возможность выбора 6 датчиков для сканирования. Благодаря простоте регистрации данных, руководствам по проведению исследований и пакету приложений QLAB, устанавливаемых по отдельному заказу, система HD5 поможет вам предоставить пациентам качественную медицинскую помощь.'
      }, {
        img: '',
        title: 'Сбалансированная работа',
        text: 'Вы всегда нацелены на то, чтобы предоставить своим пациентам медицинскую помощь самого высокого качества. В то же время, от вас требуется экономить время и ресурсы и принимать все больше пациентов. Чтобы удовлетворить всем этим требованиям, вам необходимо получать диагностическую информацию быстро, но не в ущерб качеству. Вам нужны специализированные функции, но без усложнения работы с системой. Вам нужна эргономичная система, но при этом она должна выдерживать ежедневную нагрузку при работе с большим потоком пациентов.'
      }, {
        img: '',
        title: 'Высококачественная поддержка заказчиков помогает им достигнуть успеха',
        text: 'Мы предлагаем гибкие решения нашей службы Philips Medical Capital, занимающей первое место в мировых рейтингах по техническому обучению и обучению клиническим приложениям (практические аудиторные занятия и онлайн-курсы). Мы также предлагаем услуги по профилактическому мониторингу системы, включая работу удаленного рабочего стола, отчеты по эксплуатации системы и обеспечение компьютерной безопасности системы с помощью службы Philips Product Security.*'
